webpackJsonp([0xca0d118c98c1],{5386:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/actionman.jpg" height="244" width="325" border="0" alt="actionman.jpg: " /></p>\n<p>John thinks this picture shows that we <a href="http://iowa.weblogger.com/2001/11/17">let Christopher play with dynamite</a>. While that does look like an explosion behind him to the right, Christopher is actually destructive enough without the help of explosives.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/11/computer.jpg" height="244" width="325" border="0" alt="computer.jpg: " /></p>\n<p>Thanks, <a href="http://blackholebrain.editthispage.com/"> Mike</a>, for noticing that I forgot to include captions for the pictures this morning and <a href="http://blackholebrain.editthispage.com/2001/11/16">supplying your own</a>. At least I should be thankful that I\'m not the subject of <a href="http://blackholebrain.editthispage.com/2001/11/17">the latest caption contest</a>. Although that mullah looks like he just opened Christopher\'s diaper pail.</p>',fields:{title:"Foggy Bottom",date:"17 Nov 2001",url:"https://papascott.de/2001-11-17-foggy-bottom/"}}},pathContext:{slug:"/2001-11-17-foggy-bottom/",prev:{fields:{title:"Ohne Holland",date:"16 Nov 2001",slug:"/2001-11-16-ohne-holland/"}},next:{fields:{title:"Rockaway Beach",date:"19 Nov 2001",slug:"/2001-11-19-rockaway-beach/"}}}}}});
